import {ReactTyped} from 'react-typed';

function HomePageText(props){
    return (
        <div className="hero-info">
            <div className="hero-name">
                <h1>Nathan Do</h1>
                <p>[nay-than-doe]</p>
            </div>
            <div className="hero-list">
                <p>web developer, product designer</p>
                <ol>
                    <li>attends the <span className='UW'>University of Washington</span> studying Informatics</li>
                    <li>web developer @ Ignite Robotics</li>
                    <li>also a{' '}
                        <span className='typed-wrapper'>
                            <ReactTyped
                                strings={[
                                    " digital and film photographer  üì∏",
                                    " UW Club bowler üé≥",
                                    " car enthusiast üèéÔ∏è"
                                ]}
                                typeSpeed={90}
                                backSpeed={40}
                                backDelay={1250}
                                loop
                            />
                        </span>
                    </li>
                </ol>
            </div>
        </div>
    )
}

function HomeToAboutButton(props){
    return (
        <a href="#about-section" className="hero-learn">
            <h2>learn more about me</h2>
            <img src="./img/arrow-right.svg" className='right-arrow'/>
            <svg width="18" height="10" viewBox="0 0 18 10" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M16 5L16.3669 4.49402L17.0647 5L16.3669 5.50598L16 5ZM1 5.625C0.654822 5.625 0.375 5.34518 0.375 5C0.375 4.65482 0.654822 4.375 1 4.375V5.625ZM11.3669 0.868496L16.3669 4.49402L15.6331 5.50598L10.6331 1.88046L11.3669 0.868496ZM16.3669 5.50598L11.3669 9.13151L10.6331 8.11954L15.6331 4.49402L16.3669 5.50598ZM16 5.625H1V4.375H16V5.625Z" fill="#222222"/>
            </svg>
        </a>
    )
}

export function HomePage(props) {
    return (
        <div className="hero-container"  id='home-section'>
            <div className="hero">
                <HomePageText/>
                <HomeToAboutButton/>
            </div>
        </div>
    )
}
